svg.script:
   
	var myMapApp = new mapApp(false,undefined);//与tooltip相关
	var obc;//
	var ocls;
	window.onSVGLoad=initLater();
	function initLater() {
     //this timeout is because of the bbox bug in Firefox which prevents to have access to bbox in onload scripts
              window.setTimeout("init()", 2000);
		window.setTimeout("init()",5000);
		window.setTimeout("init()",9000);
    }
	function init() {
		  
	    /* 添加tooltip*/
        //tooltip styles
         var tooltipTextStyles = {"font-family":"Arial,Helvetica","fill":"dimgray","font-size":1300};
         var tooltipRectStyles = {"fill":"white","stroke":"dimgray"};
         myMapApp.initTooltips("toolTip",tooltipTextStyles,tooltipRectStyles,10,20,3);
         //add tooltip to element
		  myMapApp.addTooltip("zta",undefined,true,false,"target","name");
		 myMapApp.addTooltip("legendnew",undefined,true,false,"target","name");
		
		  myMapApp.addTooltip("newlegend",undefined,true,false,"target","name");
		
	}

	function Closeleone(){
	    
		 document.getElementById('cir1').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir2').setAttribute("style", "visibility: hidden");
	     document.getElementById('cir3').setAttribute("style", "visibility: hidden");
		 document.getElementById('cir4').setAttribute("style", "visibility: hidden");
		 document.getElementById("mapIB").setAttribute("class","fil30");
		 document.getElementById("mapIA").setAttribute("class","fil30");
		 
		 document.getElementById("mapIIA").setAttribute("class","fil31");
		 document.getElementById("mapIIB").setAttribute("class","fil31");
		 
		 document.getElementById("mapIIIA").setAttribute("class","fil32");
		 document.getElementById("mapIIIB").setAttribute("class","fil32");
		 document.getElementById("mapIIIC").setAttribute("class","fil32");
		 document.getElementById("mapIIID").setAttribute("class","fil32");
		 document.getElementById("mapIIIE").setAttribute("class","fil32");
		 document.getElementById("mapIIIF").setAttribute("class","fil32");
		 document.getElementById("mapIVA").setAttribute("class","fil29");
		 document.getElementById("mapIVB").setAttribute("class","fil29");
	}
	function Closeletwo(n){
	    
		 document.getElementById(n).setAttribute("style", "visibility: visible");
		 
		
	}
	function Hightlight(evt) {
         var object = evt.target;
         var cls = object.id; 
         var objectMap = document.getElementById("map"+cls);
		 ocls = objectMap.getAttribute("class") || object.className;
         objectMap.setAttribute("class","fil100");
   }
   function Recover(evt) {
         var object = evt.target;
		 var cls = object.id;
         var objectMap = document.getElementById("map"+cls);
		 objectMap.setAttribute("class",ocls);
	}
